import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import { render } from "@testing-library/react";
import { observer } from 'mobx-react';

// import Home from './Home';
import About from './About';
import Contact from './Contact';
import Login from './Login';

export default function Navbar() {
  return (
    <Router>
    <div>
      <h2>Welcome to Laboratory Results Application</h2>
      <nav className="navbar">
        <ul><Link to={'/'} className="nav-link"> Home </Link></ul>
        <ul><Link to={'/contact'} className="nav-link">Contact</Link></ul>
        <ul><Link to={'/about'} className="nav-link">About</Link></ul>
        <ul><Link to={'/login'} className="nav-link">Login</Link></ul>    
        {/* <li><Link to={'/result'} className="nav-link">Result</Link></li>     */}
      </nav>
      <hr />
      
      <Switch>
          <Route path='/' component={Home} />
          <Route path='/contact' component={Contact} />
          <Route path='/about' component={About} />
          <Route path='/login' component={Login} />
          {/* <Route path='/result' component={Result} /> */}
      </Switch>
    </div>
  </Router>
  );
}
